import React from "react";

function Header(props) {
  console.log(props);
  return (
    <React.Fragment>
      <h1>{props.text}</h1>

      <h3>
        {props.name} is {props.age} years old.
      </h3>
    </React.Fragment>
  );
}
export default Header;
